import { BoardProps } from "../../../../types/types"
import { MainContainer } from "./styled"

export const ResultBoard = ({contestResults}:BoardProps) => {

    const showResults = contestResults?.map((item:string)=>{
        return <div key={item}>{item}</div>

    })


    return (
        <MainContainer>
         {showResults}

        </MainContainer>
    )
}
